import gql from "graphql-tag";

export const PaginationField = () => {
  return {
    keyArgs: false,
    read(existing = [], { args, cache }) {
      const {skip, first} = args;
      const data = cache.readQuery({ query: gql``})
    },
    merge() {}
  };
};
